import React, { useEffect, useRef } from 'react';
import './About.css';
import { motion } from 'framer-motion';

const About = () => {
  const experienceListRef = useRef(null);
  const differentiatorListRef = useRef(null);

  useEffect(() => {
    // Animation for experience list items
    if (experienceListRef.current) {
      const items = experienceListRef.current.querySelectorAll('li');
      items.forEach((item, index) => {
        const observer = new IntersectionObserver(
          ([entry]) => {
            if (entry.isIntersecting) {
              item.classList.add('animate-in');
              observer.unobserve(item);
            }
          },
          { threshold: 0.2 }
        );
        observer.observe(item);
      });
    }

    // Animation for differentiator list items
    if (differentiatorListRef.current) {
      const items = differentiatorListRef.current.querySelectorAll('li');
      items.forEach((item, index) => {
        const observer = new IntersectionObserver(
          ([entry]) => {
            if (entry.isIntersecting) {
              item.classList.add('animate-in');
              observer.unobserve(item);
            }
          },
          { threshold: 0.2 }
        );
        observer.observe(item);
      });
    }
  }, []);

  return (
    <section id="about" className="about-section">
      <div className="container">
        <motion.h2 
          className="section-title"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <span className="title-decoration">About Me</span>
        </motion.h2>

        <div className="about-content">
          <motion.div 
            className="about-image"
            initial={{ opacity: 0, x: -50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <div className="profile-image-container">
              <div className="profile-image">
                <span>JH</span>
              </div>
              <div className="profile-backdrop"></div>
            </div>
          </motion.div>

          <motion.div 
            className="about-text"
            initial={{ opacity: 0, x: 50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <h3 className="intro-text">
              <span className="highlight">Cloud Solutions Engineer</span> | Technical Sales Bridge | U.S. Army Veteran
            </h3>

            <p className="description">
              I architect and optimize cloud infrastructure (AWS/GCP) while translating technical capabilities into business results. My hybrid experience combines:
            </p>

            <ul className="experience-list" ref={experienceListRef}>
              <li>
                <div className="list-icon">
                  <i className="fas fa-laptop-code"></i>
                </div>
                <div className="list-content">
                  <h4>Full-Stack Development</h4>
                  <p>Deployed scalable apps using JavaScript/React with 30% faster deployments via AWS EC2/S3 & Google Cloud Run</p>
                </div>
              </li>

              <li>
                <div className="list-icon">
                  <i className="fas fa-cogs"></i>
                </div>
                <div className="list-content">
                  <h4>DevOps Automation</h4>
                  <p>Built CI/CD pipelines and monitoring systems to enhance reliability</p>
                </div>
              </li>

              <li>
                <div className="list-icon">
                  <i className="fas fa-handshake"></i>
                </div>
                <div className="list-content">
                  <h4>Technical Sales Insight</h4>
                  <p>6 months bridging client needs with technical solutions at ERA Solutions</p>
                </div>
              </li>

              <li>
                <div className="list-icon">
                  <i className="fas fa-medal"></i>
                </div>
                <div className="list-content">
                  <h4>Military Leadership</h4>
                  <p>Managed $2M+ in mission-critical systems with Secret Security Clearance</p>
                </div>
              </li>
            </ul>

            <h3 className="differentiator-title">
              What sets me apart:
            </h3>

            <ul className="differentiator-list" ref={differentiatorListRef}>
              <li>
                <div className="checkmark-container">
                  <span className="checkmark"><i className="fas fa-check"></i></span>
                </div>
                <div className="differentiator-content">
                  <h4>Cloud-to-business translator</h4>
                  <p>Explain technical value in ROI terms</p>
                </div>
              </li>

              <li>
                <div className="checkmark-container">
                  <span className="checkmark"><i className="fas fa-check"></i></span>
                </div>
                <div className="differentiator-content">
                  <h4>Pressure-tested problem solver</h4>
                  <p>Army-honed discipline for critical systems</p>
                </div>
              </li>

              <li>
                <div className="checkmark-container">
                  <span className="checkmark"><i className="fas fa-check"></i></span>
                </div>
                <div className="differentiator-content">
                  <h4>Continuous learner</h4>
                  <p>Pursuing AWS/Google Cloud certs + Business Marketing degree</p>
                </div>
              </li>
            </ul>

            <div className="closing-container">
              <p className="closing-text">
                Currently exploring <span className="highlight">AI/ML deployment strategies</span> to enhance cloud solutions.
              </p>

              <div className="cta-container">
                <a href="#contact" className="cta-button primary">Get in Touch</a>
                <a href="#projects" className="cta-button secondary">View My Work</a>
              </div>
            </div>
          </motion.div>
        </div>
      </div>

      <div className="background-decoration">
        <div className="bg-shape shape-1"></div>
        <div className="bg-shape shape-2"></div>
      </div>
    </section>
  );
};

export default About;
